response.about:
Я психолог экзистенциально-гуманистического направления.

В работе использую в основном процессуальный анализ(исследуем глубинные психические процессы с помощью анализа процессов, происходящих во время взаимодействия с клиентом или клиентами)

Свою работу строю на принципах: принятия, взаимного уважения, сотрудничества, активного участия и конфиденциальности.
Прохожу личную терапию и супервизию, занимаюсь повышением квалификации, являюсь участником психологических фестивалей и семинаров. 

Область моих интересов:
- Как научиться понимать/принимать/контролировать свои эмоции;
-Как узнать чего я хочу,кем хочу быть,с кем хочу быть;
-Как стать успешным и получать удовольствие от жизни, как быть счастливым;
-Как установить близкие(искренние,глубокие) отношения с окружающими;
-Как научиться отстаивать свое ...(мнение,место,право)
